import React, { useState, useEffect } from "react";
import NavBar from "./NavBar";
import { Link, useNavigate } from "react-router-dom";

const Partners = () => {
  const [partners, setPartners] = useState([]);

  // Simulate fetching data from the backend
  useEffect(() => {
    // Simulating an API call by importing a static JSON file
    const fetchPartners = async () => {
      const data = await import('./partners.json');
      setPartners(data.default);
    };

    fetchPartners();
  }, []);

  // Handle Edit Partner (Navigating to edit page)
  const handleEditPartner = (id) => {
    // Navigate to EditPartner page with the partner id as a query parameter
    window.location.href = `/edit-partner?id=${id}`;
  };

  return (
    <div>
      <NavBar />
      <div className="container mt-4">
        <h2>Partners List</h2>
        <Link to="/add-partner">
          <button className="btn btn-primary mb-3">Add New Partner</button>
        </Link>
        <table className="table">
          <thead>
            <tr>
              <th>Full Name</th>
              <th>Email</th>
              <th>Contact No</th>
              <th>Status</th>
              <th>Opening Balance</th>
              <th>Rep Name</th>
              <th>Rep Contact</th>
              <th>Edit</th>
            </tr>
          </thead>
          <tbody>
            {partners.map((partner) => (
              <tr key={partner.id}>
                <td>{partner.fullName}</td>
                <td>{partner.email}</td>
                <td>{partner.contactNo}</td>
                <td>{partner.status}</td>
                <td>{partner.openingBalance}</td>
                <td>{partner.repName}</td>
                <td>{partner.repContact}</td>
                <td>
                  <button
                    className="btn btn-warning"
                    onClick={() => handleEditPartner(partner.id)}
                  >
                    Edit
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Partners;
